import React, { Component } from 'react';
import './DisplayList.css';
import del from "../images/delete.svg";

class DisplayList extends Component {

constructor(props){
  super(props);

  this.createTasks = this.createTasks.bind(this);
}

  createTasks(item) {
    return <div className="li" onClick={() => this.display(item.list,item.key)}
    key={item.key}><p className="p">{item.list}</p></div>
  }


  display(list,key) {
    this.props.display(list,key);
  }

  render() {
    var todoEntries = this.props.entries;
    var listItems = todoEntries.map(this.createTasks);

     return (
      <div className = "ul">
      {/* <div class="AppSidebar_heading">
        <div class="AppSidebarLink">

        </div>
      </div> */}
      <div className="title">
      <svg className= "circle" width="24" height="24" viewBox="0 0 24 24">
        <circle cx="12" cy="12" r="10.6" stroke-width="1.2" stroke="currentColor" fill="none"></circle>
        <g fill="currentColor" fill-rule="evenodd">
          {/* <path d= */}
        </g>
      </svg>
    <p>MY LISTS</p>
      </div>
      {listItems}
      </div>
    );
  }
}

export default DisplayList;
